://www.detmaylienthanhphat.com</a> , </span></p>\r\n<p><span style=\\"font-size: large;\\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <a href=\\"http://www.detmaylienthanhphat.com.vn\\">http://www.detmaylienthanhphat.com.vn</a></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '<p>&nbsp;</p>\r\n<p><img src=\\"http://detmaylienthanhphat.com.vn/upload/nh_2_1.JPG\\" alt=\\"\\" width=\\"600\\" height=\\"277\\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\\"http://detmaylienthanhphat.com.vn/upload/IMG_9186.JPG\\" alt=\\"\\" width=\\"600\\" height=\\"400\\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><img src=\\"http://detmaylienthanhphat.com.vn/upload/nh_1.JPG\\" alt=\\"\\" width=\\"600\\" height=\\"450\\" /></p>', '<p>Đ&agrave;i Loan</p>', '', 'cong ty det may LIEN THANH PHAT', '', '', '', 'det may lien thanh phat', '', '', '', '', '', '', '', '', '', 1, 1, 0, 0),
