(20, 0, 0, 0, '234945121328486.jpg', 0, '234945121328486_160x114.7346427079.jpg', 'ASAs', 'nina.vn', 0, 1, 1, 'doitac', '<p class="Normal"><span style="line-height: 1.5;">Tại chung kết giải U22 Đ&ocirc;ng Nam &Aacute; diễn ra tại Brunei ng&agrave;y 23/8, U19 Việt Nam đ&atilde; thất bại 3-4 trước U19 Myanmar. Chỉ chưa đầy nửa th&aacute;ng sau thất bại kể tr&ecirc;n, U19 Việt Nam c&oacute; cơ hội "thanh to&aacute;n nợ" khi t&aacute;i ngộ U19 Myanmar tại b&aacute;n kết giải U19 Đ&ocirc;ng Nam &Aacute; h&ocirc;m nay 11/9. Lần n&agrave;y, thầy tr&ograve; HLV Graechen kh&ocirc;ng c&ograve;n phải chịu thiệt th&ograve;i về mặt thể lực khi c&oacute; số trận tương đương với đối thủ. Họ c&ograve;n c&oacute; lợi thế lớn khi được chơi tr&ecirc;n s&acirc;n nh&agrave;.</span></p>\r\n<p class="Normal">"Vấn đề l&uacute;c n&agrave;y chỉ l&agrave; cầu thủ sẽ nhập cuộc với tinh thần thế n&agrave;o. T&ocirc;i đ&atilde; n&oacute;i với họ h&atilde;y đ&aacute; tự tin như khi đối đầu U19 Nhật Bản. Kh&ocirc;ng c&oacute; g&igrave; phải qu&aacute; e d&egrave; U19 Myanmar, U19 Việt Nam kh&ocirc;ng trội hơn hẳn nhưng cũng kh&ocirc;ng hề k&eacute;m hơn họ", HLV Graechen ph&aacute;t biểu trước trận đấu.</p>\r\n<p class="Normal">&nbsp;</p>', '0', '0', '<p>0</p>', '<p>0</p>'),
(21, 0, 0, 0, '949135590685420.jpg', 0, '949135590685420_160x118.13333333333.jpg', 'ASAs', 'nina.vn', 0, 1, 1, 'doitac', '<p class="Normal"><span style="line-height: 1.5;">U19 Myanmar đang c&oacute; phong độ tốt. Sau khi v&ocirc; địch giải U22 Đ&ocirc;ng Nam &Aacute;, đo&agrave;n qu&acirc;n của HLV Gerd Zeise đ&atilde; li&ecirc;n tiếp đ&aacute;nh bại U19 Th&aacute;i Lan (2-1) v&agrave; U19 Indonesia (3-0) để gi&agrave;nh s&aacute;u điểm tuyệt đối, chiếm ng&ocirc;i đầu bảng A giải U19 Đ&ocirc;ng Nam &Aacute;.&nbsp;</span></p>\r\n<p class="Normal">Đối thủ rất mạnh nhưng HLV Graechen cho biết &ocirc;ng sẽ kh&ocirc;ng thay đổi c&aacute;ch chơi, vẫn sẽ cho c&aacute;c học tr&ograve; đ&aacute; như trận chung kết giải U22 Đ&ocirc;ng Nam &Aacute; tại Brunei, chủ động tấn c&ocirc;ng, &aacute;p đặt thế trận ngay sau tiếng c&ograve;i khai cuộc.</p>', '0', '0', '<p>0</p>', '<p>0</p>'),
(22, 0, 0, 0, '453348225834036.jpg', 0, '453348225834036_160x113.09589041096.jpg', 'Sa', 'asas', 0, 1, 1, 'doitac', '<p class="Normal">Bước v&agrave;o trận b&aacute;n kết với U19 Myanmar, U19 Việt Nam c&oacute; được lực lượng tốt nhất. Bộ đ&ocirc;i hậu vệ Trần Hữu Đ&ocirc;ng Triều v&agrave; L&ecirc; Văn Sơn đều đ&atilde; ho&agrave;n to&agrave;n b&igrave;nh phục chấn thương v&agrave; chắc chắn sẽ c&oacute; mặt trong đội h&igrave;nh xuất ph&aacute;t.</p>\r\n<p class="Normal">Tại chung kết giải U22 Đ&ocirc;ng Nam &Aacute; diễn ra tại Brunei ng&agrave;y 23/8, U19 Việt Nam đ&atilde; thất bại 3-4 trước U19 Myanmar. Chỉ chưa đầy nửa th&aacute;ng sau thất bại kể tr&ecirc;n, U19 Việt Nam c&oacute; cơ hội "thanh to&aacute;n nợ" khi t&aacute;i ngộ U19 Myanmar tại b&aacute;n kết giải U19 Đ&ocirc;ng Nam &Aacute; h&ocirc;m nay 11/9. Lần n&agrave;y, thầy tr&ograve; HLV Graechen kh&ocirc;ng c&ograve;n phải chịu thiệt th&ograve;i về mặt thể lực khi c&oacute; số trận tương đương với đối thủ. Họ c&ograve;n c&oacute; lợi thế lớn khi được chơi tr&ecirc;n s&acirc;n nh&agrave;.</p>', '0asd', 'as', '<p>0</p>', '<p>asasas</p>'),
(24, 0, 0, 0, '948552699790320.jpg', 0, '948552699790320_82x70.jpg', 'sss', '', 0, 0, 1, 'doitac', '<p>sssss</p>', '', '', '', '');
