(17, 0, 0, 'Nhà Phố Đẹp', '', 'nha-pho-dep', '', '', '<p><strong style="text-align: right; font-size: 12px; line-height: 1.5;">Ch&uacute;ng t&ocirc;i dịch vụ Sửa chữa, lắp đặt hệ thống điện d&acirc;n dụng tại nh&agrave; chuy&ecirc;n nghiệp, bảo h&agrave;nh d&agrave;i hạn (C&oacute; thể c&oacute; hoặc kh&ocirc;ng c&oacute; bản vẽ c&ocirc;ng tr&igrave;nh k&egrave;m theo):</strong></p>\r\n<p>- Sữa chữa, lắp đặt hệ thống điện d&acirc;n dụng, hệ thống nước.</p>\r\n<p>- Sửa chữa lắp đặt c&aacute;c thiết bị điện tử, điện lạnh.</p>\r\n<p>- Sửa chữa m&aacute;y giặt, m&aacute;y điều h&ograve;a, b&igrave;nh n&oacute;ng lạnh, m&aacute;y bơm nước &hellip; H&atilde;y nhấc m&aacute;y l&ecirc;n v&agrave; gọi ngay cho theo số điện thoại: 0986 768 660 ch&uacute;ng t&ocirc;i sẽ c&oacute; mặt chỉ sau 30 ph&uacute;t.</p>\r\n<p><strong>Chế độ bảo h&agrave;nh:</strong></p>\r\n<p>- Tất cả c&aacute;c m&aacute;y đ&atilde; được sửa chữa đều được d&aacute;n tem hoặc cung cấp phiếu bảo h&agrave;nh về ch&iacute;nh sự cố m&agrave; ch&uacute;ng t&ocirc;i đ&atilde; sửa trong v&ograve;ng 03 th&aacute;ng.</p>\r\n<p>- Khi kh&aacute;ch h&agrave;ng mua thiết bị mới của ch&uacute;ng t&ocirc;i sẽ t&iacute;nh thời hạn bảo h&agrave;nh của thiết bị theo h&atilde;ng sản xuất.</p>\r\n<p>- Nếu kh&aacute;ch h&agrave;ng mua thiết bị cũ của ch&uacute;ng t&ocirc;i cung cấp v&agrave;o từng loại sản phẩm v&agrave; chất lượng qu&yacute; kh&aacute;ch sẽ nhận được phiếu bảo h&agrave;nh thiết bị &iacute;t nhất trong v&ograve;ng 03 th&aacute;ng.</p>\r\n<div align="right">Theo <span style="font-style: italic;">Tuổi trẻ</span></div>', '', '', '89252359.jpg', '89252359_120x80.jpg', 1, 1, 1312537452, 1368086940, 7),
(25, 0, 0, 'Khu Du Lịch, Vui Chơi', 'Game', 'khu-du-lich-vui-choi', '', '', '', '', '', '02653937.jpg', '02653937_120x80.jpg', 6, 1, 1368241113, 0, 0),
(18, 0, 0, 'Trung Cư Cao Cấp', '', 'trung-cu-cao-cap', '', '', '<div style="font-weight: normal; text-align: left;" align="right"><br />\r\n<div class="about_detail">\r\n<p>&nbsp;Lắp đặt mới hệ thống điện, nước cho hộ gia đ&igrave;nh, cơ quan văn ph&ograve;ng.</p>\r\n<p><br />- Thi c&ocirc;ng c&ocirc;ng tr&igrave;nh cho c&aacute;c hệ thống điện nước lớn như nh&agrave; trung cư, c&aacute;c t&ograve;a cao ốc, biệt thự.<br /><br />-&nbsp;<strong>Sửa chữa điện nước</strong>: sửa ống nước, lắp đặt đường nước mới, thay van v&ograve;i nước.<br /><br />- Sửa chữa điện mạch: điện ch&igrave;m, điện nổi, điện chập, ch&aacute;y, mất điện, đi lại d&acirc;y mới.<br /><br />-&nbsp;<strong>Sửa chữa m&aacute;y bơm nước</strong>&nbsp;: m&aacute;y kh&ocirc;ng l&ecirc;n, vỡ ống nước, thay m&aacute;y mới, thay lại đường ống, cuốn lại m&aacute;y.<br /><br />- Sửa chữa thiết bị nh&agrave; tắm : Sen tắm, v&ograve;i chậu, sịt, lavabo, bệt.<br /><br />- Sửa chữa b&igrave;nh n&oacute;ng lạnh : mất điện, nước kh&ocirc;ng n&oacute;ng, r&ograve; điện, lắp th&ecirc;m chống giật, thay b&igrave;nh mới.<br /><br />- Sửa chữa hệ thống điện thắp s&aacute;ng, thay mới b&oacute;ng điện, d&acirc;y điện.<br /><br />- Sửa chữa, khắc phục sự cố hệ thống điện ngầm, c&aacute;p quang.<br /><br />- Sửa chữa c&aacute;c loại m&aacute;y biến &aacute;p, ổn &aacute;p, c&ocirc;ng tơ, bộ chuyển đổi điện năng, quạt điện.<br /><br /><img style="font-size: 12px; line-height: 1.5;" src="http://xaydungnamsao.com/hoanghung/5/images/5-electrical-services-sydney.jpg" alt="sửa chữa điện nước" /><strong><img src="http://xaydungnamsao.com/home/library/module_new/Sua-chua-dien-nuoc1359562011_s250.jpg" alt="sửa chữa điện nước" /></strong></p>\r\n<p><span><strong>C&aacute;c bước tiến h&agrave;nh sửa chữa điện nước</strong></span><br /><br /><strong>Bước 1.</strong><br /><br />Tiếp nhận th&ocirc;ng tin từ kh&aacute;ch h&agrave;ng, ph&acirc;n t&iacute;ch sử l&yacute; ph&acirc;n loại c&aacute;c hạng mục theo y&ecirc;u cầu của kh&aacute;ch h&agrave;ng.<br /><br /><strong>Bước 2.</strong><br /><br />C&ocirc;ng ty sẽ cử c&aacute;n bộ kỹ thuật (CBKT) gặp kh&aacute;ch h&agrave;ng theo đ&uacute;ng cấp độ c&ocirc;ng việc y&ecirc;u cầu, thời gian v&agrave; địa điểm đ&atilde; hẹn. CBKT sẽ khảo s&aacute;t, ph&acirc;n t&iacute;ch, tư vấn để ph&acirc;n cấp độ c&ocirc;ng việc, l&ecirc;n kế hoạch b&aacute;o gi&aacute;, thi c&ocirc;ng theo thỏa thuận của đ&ocirc;i b&ecirc;n. B&aacute;o gi&aacute; sẽ cố gắng được gửi trong ng&agrave;y hoặc chậm nhất v&agrave;o h&ocirc;m sau qua fax, email, gửi trực tiếp cho kh&aacute;ch h&agrave;ng.<br /><br /><strong>Bước 3.</strong><br /><br />Sau b&aacute;o gi&aacute; l&agrave; việc trao đổi thỏa thuận giữa đ&ocirc;i b&ecirc;n để đi đến thống nhất về gi&aacute;, chất liệu cho từng hạng mục, biện ph&aacute;p thi c&ocirc;ng, tiến độ thi c&ocirc;ng, hợp đồng thi c&ocirc;ng,... &nbsp;<br /><br /><strong>Bước 4.</strong><br /><br />Tiến h&agrave;nh triển khai thi c&ocirc;ng. C&ocirc;ng ty tổ chức c&ocirc;ng nh&acirc;n v&agrave; CBKT để sửa chữa theo hợp đồng. Chủ nh&agrave; cử người th&acirc;n gi&aacute;m s&aacute;t c&ocirc;ng việc cũng như kiểm so&aacute;t t&agrave;i sản trong nh&agrave;. Đ&ocirc;i b&ecirc;n kết hợp để c&ocirc;ng việc sửa chữa điện nước th&agrave;nh c&ocirc;ng tốt đẹp trong thời gian sớm nhất theo y&ecirc;u cầu của bạn.&nbsp;<br /><br /><strong>Bước 5.</strong><br /><br />Trong qu&aacute; tr&igrave;nh thi c&ocirc;ng nếu c&oacute; thay đổi ph&aacute;t sinh tăng hay giảm gia chủ vui l&ograve;ng x&aacute;c nhận cụ thể c&ocirc;ng việc để thuận tiện cho việc l&agrave;m phụ lục hợp đồng v&agrave; quyết to&aacute;n thanh l&yacute; hợp đồng được su&ocirc;n sẻ ch&iacute;nh x&aacute;c. &nbsp;&nbsp;<br /><br /><strong>Bước 6 :</strong><br /><br />Chế độ hậu m&atilde;i, b&agrave;o h&agrave;nh điện nước: sẽ t&ugrave;y thuộc v&agrave;o cấp độ c&ocirc;ng việc m&agrave; đ&ocirc;i b&ecirc;n k&yacute; kết chế độ bảo h&agrave;nh cho c&ocirc;ng việc sửa chữa đ&oacute;.&nbsp;Sau khi b&agrave;n giao đưa v&agrave;o sửa dụng nếu c&oacute; vấn đề g&igrave; trở ngại cần khắc phục giải quyết gia chủ li&ecirc;n hệ ngay c&ocirc;ng ty để được phục vụ trong ng&agrave;y cho qu&iacute; kh&aacute;ch. Nếu kh&ocirc;ng h&agrave;i l&ograve;ng bất cứ vấn đề g&igrave; chủ nh&agrave; li&ecirc;n hệ để được giải quyết thỏa đ&aacute;ng.</p>\r\n</div>\r\n<div>\r\n<div id="fb-root" class=" fb_reset">\r\n<div style="text-align: left;">&nbsp;</div>\r\n<div>&nbsp;</div>\r\n</div>\r\n<div class="fb-comments fb_iframe_widget" data-href="http://xaydungnamsao.com/home/Xay-dung/Sua-nha_Sua-chua-dien-nuoc/vn" data-width="700" data-num-posts="2">&nbsp;</div>\r\n</div>\r\nTheo <span style="font-style: italic;">VTV</span></div>', '', '', '50532182.jpg', '50532182_120x80.jpg', 3, 1, 1312537520, 1368086861, 12),
