(23, 0, 0, 'Lịch sử hình thành và phát triển', 'Lịch sử hình thành và phát triển En', 'lich-su-hinh-thanh-va-phat-trien', 'asasd', 'qweqwe', '<p><strong>Ng&agrave;y 01/01/1995</strong><span>: Tổng C&ocirc;ng ty Than Việt Nam bắt đầu hoạt động theo Điều lệ được ban h&agrave;nh tại Nghị định 13-CP ng&agrave;y 17/01/1995 của Ch&iacute;nh phủ.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 11/1996</strong><span>: Ng&agrave;nh Than đ&oacute;n nhận Hu&acirc;n chương Sao v&agrave;ng do c&oacute; nhiều c&ocirc;ng lao trong 50 năm x&acirc;y dựng v&agrave; bảo vệ Tổ quốc.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 12/1997</strong><span>: Than Việt Nam đạt 10,7 triệu tấn than thương phẩm, ho&agrave;n th&agrave;nh vượt mức sản lượng của năm 2000 do Đại hội Đảng to&agrave;n quốc lần thứ VIII giao cho Ng&agrave;nh Than (10 triệu tấn).</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 5/1999</strong><span>: Điều chỉnh giảm sản xuất than theo nhu cầu thị trường, giải quyết th&agrave;nh c&ocirc;ng quan hệ cung - cầu do chịu ảnh hưởng của cuộc khủng hoảng kinh tế khu vực. Cổ phần h&oacute;a c&ocirc;ng ty than đầu ti&ecirc;n.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 5/2001</strong><span>: Tiếp nhận Tổng C&ocirc;ng ty cơ kh&iacute; năng lượng v&agrave; mỏ s&aacute;p nhập v&agrave;o Tổng C&ocirc;ng ty Than Việt Nam. Đến nay, ng&agrave;nh cơ kh&iacute; đ&atilde; c&oacute; bước ph&aacute;t triển vượt bậc.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 4/2002:&nbsp;</strong><span>Khởi c&ocirc;ng x&acirc;y dựng Nh&agrave; m&aacute;y điện Na Dương - nh&agrave; m&aacute;y nhiệt điện đầu ti&ecirc;n của Tập đo&agrave;n. Đến nay, Tập đo&agrave;n đ&atilde; c&oacute; 9 dự &aacute;n nh&aacute; m&aacute;y điện đ&atilde; v&agrave; đang x&acirc;y dựng, trong đ&oacute; c&oacute; 5 nh&agrave; m&aacute;y đ&atilde; đi v&agrave;o hoạt động.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 8/2003</strong><span>: Xuất xưởng l&ocirc; xe tải KRAZ đầu ti&ecirc;n được lắp r&aacute;p tại Việt Nam. Đến nay, ng&agrave;nh c&ocirc;ng nghiệp &ocirc; t&ocirc; TKV đ&atilde; sản xuất, lắp r&aacute;p th&ecirc;m c&aacute;c loại xe KAMAZ, SCANIA.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 12/2003</strong><span>: Đạt 18,8 triệu tấn than thương phẩm, vượt chỉ ti&ecirc;u sản lượng của năm 2005 do Đại hội Đảng lần thứ IX đề ra cho ng&agrave;nh Than (15 triệu tấn).</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 12/2004</strong><span>: Đạt 24,7 triệu tấn than thương phẩm (trong đ&oacute; xuất khẩu 10,5 triệu tấn), đạt mục ti&ecirc;u quy hoạch của năm 2010 (23-24 triệu tấn).</span></p>', '<p><strong>Nhập ND tiếng Anh</strong></p>\r\n<p><strong>Ng&agrave;y 01/01/1995</strong><span>: Tổng C&ocirc;ng ty Than Việt Nam bắt đầu hoạt động theo Điều lệ được ban h&agrave;nh tại Nghị định 13-CP ng&agrave;y 17/01/1995 của Ch&iacute;nh phủ.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 11/1996</strong><span>: Ng&agrave;nh Than đ&oacute;n nhận Hu&acirc;n chương Sao v&agrave;ng do c&oacute; nhiều c&ocirc;ng lao trong 50 năm x&acirc;y dựng v&agrave; bảo vệ Tổ quốc.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 12/1997</strong><span>: Than Việt Nam đạt 10,7 triệu tấn than thương phẩm, ho&agrave;n th&agrave;nh vượt mức sản lượng của năm 2000 do Đại hội Đảng to&agrave;n quốc lần thứ VIII giao cho Ng&agrave;nh Than (10 triệu tấn).</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 5/1999</strong><span>: Điều chỉnh giảm sản xuất than theo nhu cầu thị trường, giải quyết th&agrave;nh c&ocirc;ng quan hệ cung - cầu do chịu ảnh hưởng của cuộc khủng hoảng kinh tế khu vực. Cổ phần h&oacute;a c&ocirc;ng ty than đầu ti&ecirc;n.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 5/2001</strong><span>: Tiếp nhận Tổng C&ocirc;ng ty cơ kh&iacute; năng lượng v&agrave; mỏ s&aacute;p nhập v&agrave;o Tổng C&ocirc;ng ty Than Việt Nam. Đến nay, ng&agrave;nh cơ kh&iacute; đ&atilde; c&oacute; bước ph&aacute;t triển vượt bậc.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 4/2002:&nbsp;</strong><span>Khởi c&ocirc;ng x&acirc;y dựng Nh&agrave; m&aacute;y điện Na Dương - nh&agrave; m&aacute;y nhiệt điện đầu ti&ecirc;n của Tập đo&agrave;n. Đến nay, Tập đo&agrave;n đ&atilde; c&oacute; 9 dự &aacute;n nh&aacute; m&aacute;y điện đ&atilde; v&agrave; đang x&acirc;y dựng, trong đ&oacute; c&oacute; 5 nh&agrave; m&aacute;y đ&atilde; đi v&agrave;o hoạt động.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 8/2003</strong><span>: Xuất xưởng l&ocirc; xe tải KRAZ đầu ti&ecirc;n được lắp r&aacute;p tại Việt Nam. Đến nay, ng&agrave;nh c&ocirc;ng nghiệp &ocirc; t&ocirc; TKV đ&atilde; sản xuất, lắp r&aacute;p th&ecirc;m c&aacute;c loại xe KAMAZ, SCANIA.</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 12/2003</strong><span>: Đạt 18,8 triệu tấn than thương phẩm, vượt chỉ ti&ecirc;u sản lượng của năm 2005 do Đại hội Đảng lần thứ IX đề ra cho ng&agrave;nh Than (15 triệu tấn).</span><br /><span>&nbsp;</span><br /><strong>Th&aacute;ng 12/2004</strong><span>: Đạt 24,7 triệu tấn than thương phẩm (trong đ&oacute; xuất khẩu 10,5 triệu tấn), đạt mục ti&ecirc;u quy hoạch của năm 2010 (23-24 triệu tấn).</span></p>', '', '13114688.jpg', '13114688_120x80.jpg', 2, 1, 1365041224, 1365150354, 0),
