INSERT INTO `table_news` (`id`, `id_cat`, `tinnoibat`, `ten_vi`, `ten_en`, `ten_ta`, `ten_ja`, `tenkhongdau`, `mota_vi`, `mota_en`, `mota_ta`, `mota_ja`, `noidung_vi`, `noidung_en`, `noidung_ta`, `noidung_ja`, `loaitin`, `photo`, `thumb`, `title_vi`, `title_en`, `title_ta`, `title_ja`, `keywords_vi`, `keywords_en`, `keywords_ta`, `keywords_ja`, `description_vi`, `description_en`, `description_ta`, `description_ja`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `luotxem`) VALUES
(3, 5, 0, 'Google ra mắt các kênh YouTube thu phí ', 'Anh', 'Đài Loan', 'Nhật Bản', 'google-ra-mat-cac-kenh-youtube-thu-phi', 'Ngày 9/5, hãng Google đã ra thông báo cho biết họ vừa ra mắt chương trình thí điểm, trong đó cho phép một nhóm đối tác YouTube thu phí thuê bao đối với người dùng để truy cập vào nội dung của họ.', 'Anh', 'Đài Loan', 'Nhật', '<p class="Normal">Tập đo&agrave;n Xăng dầu Việt Nam (Petrolimex) vừa c&ocirc;ng bố giảm 470 đồng đối với mỗi l&iacute;t xăng RON 92 b&aacute;n ra trong hệ thống từ 12 giờ ng&agrave;y 29/8. Gi&aacute; b&aacute;n lẻ đối với mặt h&agrave;ng n&agrave;y, theo đ&oacute; giảm về&nbsp;<span>23.740 đồng một l&iacute;t.&nbsp;</span></p>\r\n<p class="Normal"><span>Dầu diesel 0,05S v&agrave; dầu hỏa cũng được c&ocirc;ng bố giảm 160-180 đồng, về lần lượt 21.930 v&agrave; 22.070 đồng một l&iacute;t</span><span>. Trong khi đ&oacute;, mức giảm đối với dầu maz&uacute;t l&agrave; 60 đồng, về 18.690 đồng một kg.</span></p>\r\n<p class="Normal"><strong>Gi&aacute; b&aacute;n lẻ xăng dầu được Petrolimex &aacute;p dụng từ 12h ng&agrave;y 29/8</strong></p>\r\n<table class="tplCaption" border="0" cellspacing="0" cellpadding="3" align="center">\r\n<tbody>\r\n<tr>\r\n<td><img src="http://m.f25.img.vnecdn.net/2014/08/29/Giabanle-400-1364-1409289769.jpg" alt="Giabanle-400-1364-1409289769.jpg" data-natural-="" data-width="400" data-pwidth="480" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class="Normal">Trước đ&oacute;, li&ecirc;n Bộ T&agrave;i ch&iacute;nh - C&ocirc;ng Thương đ&atilde; c&oacute; văn bản y&ecirc;u cầu c&aacute;c doanh nghiệp đầu mối điều chỉnh giảm gi&aacute; c&aacute;c mặt h&agrave;ng n&agrave;y. Cụ thể, gi&aacute; b&aacute;n hiện h&agrave;nh đối với xăng RON 92 đ&atilde; vượt mức cơ sở 464 đồng mỗi l&iacute;t. Do vậy, doanh nghiệp được y&ecirc;u cầu điều chỉnh để mức b&aacute;n lẻ kh&ocirc;ng cao hơn 23.746 đồng một l&iacute;t.&nbsp;<span>Gi&aacute; b&aacute;n dầu diezel, madut v&agrave; dầu hỏa cũng vượt mức cơ sở 52-151 đồng mỗi l&iacute;t, kg.&nbsp;</span></p>', '<p>Anh</p>', '<p>Đ&agrave;i Loan</p>', '<p>Nhật Bản</p>', '', '72639872.jpg', '72639872_150x120.jpg', 'Việt', 'Anh', 'Đài Loan', 'Nhật Bản 1Nhật Bản', 'Việt', 'Anh', 'Đài Loan', 'Nhật Bản', 'Việt', 'Anh', 'Đài Loan', 'Nhật Bản', 1, 1, 1312536264, 1409300614, 3),
(26, 6, 0, 'Việt Nam', 'Anh', 'Đài Loan', 'Nhật Bản', 'viet-nam', 'Việt Nam', 'Anh', 'Đài Loan', 'Nhật Bản', '<p>Việt Nam</p>', '<p>Anh</p>', '<p>Đ&agrave;i Loan</p>', '<p>Nhật Bản</p>', '', '11619137.jpg', '11619137_150x120.jpg', 'Việt Nam', 'Anh', 'Đài Loan', 'Nhật Bản', 'Việt Nam', 'Anh', 'Đài Loan', 'Nhật Bản', 'Việt Nam', 'Anh', 'Đài Loan', 'Nhật Bản', 1, 1, 1409129322, 1409298203, 0),
(28, 7, 0, 'Tiểu chuẩn ISO 001', '', '', '', 'tieu-chuan-iso-001', '', '', '', '', '<div class="block_timer_share">\r\n<div class="block_timer left txt_666"><strong><span style="font-size: 2em; line-height: 1.5;">GS Ho&agrave;ng Ch&iacute; Bảo: ''Kẻ cơ hội v&agrave;o vị tr&iacute; cấp cao sẽ l&agrave; đại họa''</span></strong></div>\r\n</div>\r\n<div class="short_intro txt_666">"Nếu đ&aacute;nh gi&aacute;, bố tr&iacute; c&aacute;n bộ kh&ocirc;ng đ&uacute;ng, để lọt lưới kẻ cơ hội v&agrave;o cương vị cấp cao sẽ rất c&oacute; hại cho sự ph&aacute;t triển của Đảng, lợi &iacute;ch v&agrave; quyền lợi của d&acirc;n", GS Ho&agrave;ng Ch&iacute; Bảo, Chủ tịch Hội đồng Khoa học, Viện Khoa học nghi&ecirc;n cứu nh&acirc;n t&agrave;i - nh&acirc;n lực n&oacute;i.</div>\r\n<div class="relative_new">\r\n<ul class="list_news_dot_3x3_300">\r\n<li><a href="http://vnexpress.net/tin-tuc/thoi-su/di-chuc-ho-chu-tich-quan-chung-chi-yeu-men-nguoi-co-dao-duc-3035813.html">Di ch&uacute;c Hồ chủ tịch: ''Quần ch&uacute;ng chỉ y&ecirc;u mến người c&oacute; đạo đức''</a></li>\r\n</ul>\r\n</div>\r\n<div id="left_calculator">\r\n<div class="fck_detail width_common">\r\n<p class="Normal"><em>- Trong di ch&uacute;c, Chủ tịch Hồ Ch&iacute; Minh viết, Đảng phải được x&acirc;y dựng bằng tinh thần đo&agrave;n kết từ trung ương đến c&aacute;c chi bộ, phải giữ g&igrave;n như giữ g&igrave;n con ngươi của mắt m&igrave;nh. Lời dạy ấy được thực hiện như thế n&agrave;o trong giai đoạn hiện nay thưa &ocirc;ng?</em></p>\r\n<p class="Normal"><span>- Năm nay</span>&nbsp;ch&uacute;ng ta kỷ niệm 45 năm thực hiện di ch&uacute;c Hồ Chủ tịch, nếu t&iacute;nh từ ng&agrave;y đặt b&uacute;t đầu ti&ecirc;n đ&atilde; l&agrave; 49 năm, Đảng khởi xướng l&atilde;nh đạo c&ocirc;ng cuộc đổi mới gần 30 năm. Những chặng đường lịch sử ấy đều li&ecirc;n quan đến một vấn đề rất then chốt l&agrave; Đảng v&agrave; x&acirc;y dựng Đảng. Học tập l&agrave;m theo di ch&uacute;c của B&aacute;c về vấn đề x&acirc;y dựng Đảng phải đặc biệt ch&uacute; &yacute; đến điều B&aacute;c nhấn mạnh ngay từ đầu l&agrave; "Trong Đảng, từ trung ương tới chi bộ phải giữ g&igrave;n sự đo&agrave;n kết v&agrave; thống nhất như giữ g&igrave;n con ngươi của mắt m&igrave;nh". B&aacute;c cũng nhấn mạnh, đo&agrave;n kết kh&ocirc;ng chỉ l&agrave; truyền thống qu&yacute; b&aacute;u của Đảng m&agrave; c&ograve;n của cả d&acirc;n tộc Việt Nam. Nhờ đo&agrave;n kết m&agrave; c&oacute; sức mạnh, chia rẽ th&igrave; sẽ thất bại, suy yếu.</p>\r\n<p class="Normal">Điều B&aacute;c bận t&acirc;m v&agrave; lo lắng l&agrave; khi Đảng cầm quyền th&igrave; c&oacute; giữ được đo&agrave;n kết kh&ocirc;ng,&nbsp;<span>cơ quan l&atilde;nh đạo c&oacute; phạm phải sai lầm về đường lối, chủ trương, ch&iacute;nh s&aacute;ch hay kh&ocirc;ng? Tất cả điều n&agrave;y kh&ocirc;ng chỉ li&ecirc;n quan đến Đảng m&agrave; c&ograve;n ảnh hưởng đến cuộc sống của nh&acirc;n d&acirc;n v&agrave; cả d&acirc;n tộc.</span></p>\r\n<p class="Normal">Nghị quyết trung ương 4 kho&aacute; 11 đ&atilde; n&oacute;i r&otilde; những vấn đề cấp b&aacute;ch về x&acirc;y dựng Đảng, trong đ&oacute; c&oacute; vấn đề suy tho&aacute;i kinh tế, ch&iacute;nh trị, tư tưởng, đạo đức, lối sống của bộ phận kh&ocirc;ng nhỏ c&aacute;n bộ quản l&yacute; c&aacute;c cấp, kể cả cấp cao. Trong sự suy tho&aacute;i n&agrave;y, đương nhi&ecirc;n kh&ocirc;ng thể kh&ocirc;ng c&oacute; sự mất đo&agrave;n kết.&nbsp;</p>\r\n</div>\r\n</div>', '', '', '', '', '01678210.jpg', '01678210_150x120.jpg', '', '', '', '', '', '', '', '', '', '', '', '', 1, 1, 1409366113, 1409367555, 0);
