(26, 0, 0, 'Thử', '', '', '', 'thu', 'Bán biệt thự đẹp, hẽm 2.5m đường Trần Xuân Soạn, F. Tân Kiểng, Q7 05-08-2011 11:25:18 AM // 2 lượt xem Bán nhà đẹp 1 lững đúc hẽm 2.5m đường Trần Xuân Soạn, F. Tân Kiểng, Q7,DT: 4x10, hướng Đông Bắc, nhà đẹp gồm 1PN lớn, 1wc, tầng trệt để thoáng và suốt. Thích hợp gia đình trẻ mới ra riêng. SH, ĐN chính. Vị trí nhà cách đường chính 50m. Cách TTQ1 khoản 10 phút. Cách cầu Nguyễn Văn Cừ 500m. Giá bán 1.25 tỷ.', '', '', '', '<p><span>B&aacute;n biệt thự đẹp, hẽm 2.5m đường Trần Xu&acirc;n Soạn, F. T&acirc;n Kiểng, Q7&nbsp;</span><span><em>05-08-2011 11:25:18 AM // 2 lượt xem</em></span><span>&nbsp;B&aacute;n nh&agrave; đẹp 1 lững đ&uacute;c hẽm 2.5m đường Trần Xu&acirc;n Soạn, F. T&acirc;n Kiểng, Q7,DT: 4x10, hướng Đ&ocirc;ng Bắc, nh&agrave; đẹp gồm 1PN lớn, 1wc, tầng trệt để tho&aacute;ng v&agrave; suốt. Th&iacute;ch hợp gia đ&igrave;nh trẻ mới ra ri&ecirc;ng. SH, ĐN ch&iacute;nh. Vị tr&iacute; nh&agrave; c&aacute;ch đường ch&iacute;nh 50m. C&aacute;ch TTQ1 khoản 10 ph&uacute;t. C&aacute;ch cầu Nguyễn Văn Cừ 500m. Gi&aacute; b&aacute;n 1.25 tỷ.</span></p>', '', '', '', '', '12682703.jpg', '12682703_200x110.jpg', '', '', '', '', '', '', '', '', '', '', '', '', 1, 1, 1409326926, 0, 0),
(25, 0, 0, 'Với MU, Sir Alex là hợp đồng thế kỷ', 'Với MU, Sir Alex là hợp đồng thế kỷ', 'Đài Loan', 'Nhật Bản', 'voi-mu-sir-alex-la-hop-dong-the-ky', 'Sir Alex ký nhiều hợp đồng thành công, nhưng chính ông mới là bản hợp đồng tốt nhất của MU.', 'Với MU, Sir Alex là hợp đồng thế kỷ', 'Đài Loan', 'Nhật Bản', '<p><span>Sir Alex k&yacute; nhiều hợp đồng th&agrave;nh c&ocirc;ng&nbsp;</span></p>\r\n<p><span> nhưng ch&iacute;nh &ocirc;ng mới l&agrave; bản hợp đồng tốt nhất của MU.</span></p>\r\n<p>Khi&nbsp;<strong>Sir Alex</strong>&nbsp;tuy&ecirc;n bố giải nghệ, Eric Cantona, người được cho l&agrave; bản hợp đồng th&agrave;nh c&ocirc;ng nhất dưới triều đại Ferguson, bảo rằng: &ldquo;C&oacute; thể c&oacute; một Cantona, Giggs, Scholes hay Ronaldo thứ hai. Nhưng Sir Alex l&agrave; duy nhất trong lịch sử Manchester United&rdquo;. Cantona kh&ocirc;ng hề qu&aacute; lời. Nếu 26 năm trước những nh&acirc;n vật c&oacute; m&aacute;u mặt nhất tại Old Trafford kh&ocirc;ng chủ động mời Ferguson, lịch sử MU c&oacute; thể đ&atilde; đi theo hướng rất kh&aacute;c.</p>\r\n<p>Kể từ sau khi Sir Matt Busby về hưu, MU đ&atilde; ch&igrave;m trong 15 năm đen tối với 4 đời HLV. Người cuối c&ugrave;ng l&agrave; Ron Atkinson thậm ch&iacute; đ&atilde; xin từ chức 1 năm trước khi Ferguson đồng &yacute; tới Old Trafford. Th&agrave;nh t&iacute;ch bết b&aacute;t của đội b&oacute;ng chỉ thay đổi khi Chủ tịch Martin Edwards, người th&iacute;ch b&oacute;ng bầu dục hơn b&oacute;ng đ&aacute; v&agrave; đ&atilde; từng c&oacute; &yacute; định b&aacute;n CLB v&agrave;o năm 1984, quyết định phải cải tổ băng ghế huấn luyện để đưa MU tho&aacute;t khỏi vũng b&ugrave;n.</p>\r\n<p><img class="news-image" src="http://img-hcm.24hstatic.com:8008/upload/2-2013/images/2013-05-10/1368201620-bong-da-ferguson2.jpg" alt="Với MU, Sir Alex l&agrave; hợp đồng thế kỷ, B&oacute;ng đ&aacute;, Sir Alex Ferguson nghi huu, Sir Alex Ferguson ve huu, Sir Alex Ferguson chia tay mu, Sir Alex nghi huu, Sir Alex ve huu, Sir Alex chia tay MU, Sir Alex Ferguson giai nghe, Sir Alex giai nghe, Alex Ferguson nghi huu, Alex Ferguson ve huu, Alex Ferguson chia tay MU, Alex ferguson, Sir Alex, MU, bong da, bongda, bong da so, tin bong da, tin chuyen nhuong, bong da 24h, bao, bao bong da" /></p>\r\n<p>Ferguson đến khi MU đang gặp kh&oacute; khăn</p>\r\n<p>Cuộc họp cấp cao giữa Edwards với c&aacute;c cộng sự th&acirc;n cận Mike Edelson, Maurice Watkins v&agrave; Sir Bobby Charlton v&agrave;o th&aacute;ng 11 năm 1986 đ&atilde; đi đến thống nhất rằng Alex Ferguson l&agrave; sự lựa chọn số 1 cho chiếc ghế n&oacute;ng. Fergie khi đ&oacute; l&agrave; một HLV trẻ xuất sắc của Vương quốc Anh, người đ&atilde; đưa Aberdeen chinh phục một loạt danh hiệu tại Scotland v&agrave; ph&aacute; vỡ thế song m&atilde; giữa Celtic v&agrave; Rangers. Mặc d&ugrave; vậy, Edwards kh&ocirc;ng chắc Ferguson muốn đến một đội b&oacute;ng đ&atilde; sa s&uacute;t thảm hại như MU, nhất l&agrave; khi &ocirc;ng từng thẳng thừng từ chối cả Tottenham v&agrave; Arsenal v&agrave;o m&ugrave;a H&egrave; năm 1986.</p>\r\n<p>Nhưng rồi khi tất cả bộ sậu MU lặn lội đến gặp Ferguson sau một cuộc hẹn b&iacute; mật qua điện thoại, vị HLV người Glasgow đ&atilde; gật đầu đồng &yacute;. Rất nhanh ch&oacute;ng, 72 giờ sau đ&oacute;, bản hợp đồng được ho&agrave;n tất v&agrave; Ferguson trở th&agrave;nh HLV tiếp theo được kỳ vọng sẽ nối tiếp th&agrave;nh c&ocirc;ng của Sir Matt Busby. Ng&agrave;y 6/11/1986, Alex nhậm chức, mở ra thời kỳ 26 năm đại th&agrave;nh c&ocirc;ng trong lịch sử Quỷ đỏ. &Ocirc;ng vượt qua cả những kỳ t&iacute;ch của huyền thoại Busby để trở th&agrave;nh chiến lược gia vĩ đại nhất mọi thời đại của MU.</p>\r\n<p><img class="news-image" src="http://img-hcm.24hstatic.com:8008/upload/2-2013/images/2013-05-10/1368201620-bong-da-ferguson.jpg" alt="Với MU, Sir Alex l&agrave; hợp đồng thế kỷ, B&oacute;ng đ&aacute;, Sir Alex Ferguson nghi huu, Sir Alex Ferguson ve huu, Sir Alex Ferguson chia tay mu, Sir Alex nghi huu, Sir Alex ve huu, Sir Alex chia tay MU, Sir Alex Ferguson giai nghe, Sir Alex giai nghe, Alex Ferguson nghi huu, Alex Ferguson ve huu, Alex Ferguson chia tay MU, Alex ferguson, Sir Alex, MU, bong da, bongda, bong da so, tin bong da, tin chuyen nhuong, bong da 24h, bao, bao bong da" /></p>\r\n<p>Edwards (tr&aacute;i)&nbsp;đ&atilde; rất ki&ecirc;n nhẫn với Ferguson</p>\r\n<p>Tuy nhi&ecirc;n, th&agrave;nh c&ocirc;ng đến với Ferguson kh&ocirc;ng hề dễ d&agrave;ng. 4 năm đầu ở Old Trafford l&agrave; thảm họa thực sự. Đặc biệt l&agrave; năm 1989, khi Ferguson bị ch&iacute;nh c&aacute;c CĐV nh&agrave; quay lưng, &ocirc;ng đ&atilde; gọi đ&oacute; l&agrave; &ldquo;năm đen tối nhất trong sự nghiệp&rdquo;. Nhưng mối t&igrave;nh MU &ndash; Ferguson vẫn vượt qua được s&oacute;ng gi&oacute;, nhờ sự ki&ecirc;n định v&agrave; s&aacute;ng suốt của BLĐ đội b&oacute;ng, m&agrave; ở đ&acirc;y người đ&oacute;ng vai tr&ograve; quyết định l&agrave; Chủ tịch Martin Edwards. Sự ki&ecirc;n nhẫn của Edwards đ&atilde; được đền đ&aacute;p xứng đ&aacute;ng v&agrave; dĩ nhi&ecirc;n n&oacute; đ&atilde; gi&uacute;p Ferguson tạo n&ecirc;n một trong những đế chế b&oacute;ng đ&aacute; h&ugrave;ng mạnh nhất thế giới.<br /><br />Nếu như Ferguson c&oacute; ảnh hưởng cực lớn đến sự nghiệp của một loạt những ng&ocirc;i sao h&agrave;ng đầu, như Cantona, Giggs, Keane, Scholes, Beckham, Rooney, Ronaldo&hellip; th&igrave; kh&ocirc;ng nghi ngờ g&igrave; nữa, Maritn Edwards ch&iacute;nh l&agrave; người c&oacute; ảnh hưởng lớn nhất đến sự nghiệp vinh quang của&nbsp;<span style="text-decoration: underline;">Sir Alex</span>. Nếu ng&agrave;y ấy Edwards kh&ocirc;ng t&igrave;m đến hoặc sớm tống cổ Ferguson khỏi Old Trafford, th&igrave; lịch sử b&oacute;ng đ&aacute; Anh v&agrave; ch&acirc;u &Acirc;u cũng như thế giới trong 26 năm rưỡi qua hẳn đ&atilde; kh&aacute;c rất nhiều.</p>\r\n<p><span>&nbsp;</span></p>', '<p>Với MU, Sir Alex l&agrave; hợp đồng thế kỷ</p>', '<p>Đ&agrave;i Loan</p>', '<p>Nhật Bản</p>', '', '84071951.jpg', '84071951_200x110.jpg', 'Với MU, Sir Alex là hợp đồng thế kỷ', 'Với MU, Sir Alex là hợp đồng thế kỷ', 'Đài Loan', 'Nhật Bản 1Nhật Bản', 'Với MU, Sir Alex là hợp đồng thế kỷ', 'Với MU, Sir Alex là hợp đồng thế kỷ', 'Đài Loan', 'Nhật Bản', 'Với MU, Sir Alex là hợp đồng thế kỷ', 'Với MU, Sir Alex là hợp đồng thế kỷ', 'Đài Loan', 'Nhật Bản', 1, 1, 1368241713, 1409326617, 2),
